        for include in includes:
            # Filter standard library vs custom headers
            if not include.startswith('std/') and not include.endswith('.h'):
                dependencies.append(include)

        # Extract namespace usage
        namespaces = re.findall(r'using\s+namespace\s+([^;]+);', code)
        dependencies.extend(namespaces)

        # Extract template specializations and concepts
        concepts = re.findall(r'concept\s+(\w+)', code)
        dependencies.extend([f"concept:{concept}" for concept in concepts])

